        height: '100vh',
        width : '100vw',
        backgroundImage: "linear-gradient(to right, #000000, #3533cd 60%)",
    };

    const video_div = {
        position : "relative",
        borderRadius: '10px',
        textAlign: 'center',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.3)',
        height : "50vh",
        width: '35vw',
        color: "white",
        border : "5px dotted white",
        borderRadius : "60px",
        top : "10vh",
        left : "32vw",
    };

    const header = {
        position : "relative",
        top : "5vh",
        left : "44vw",
        color : "white",
    };

    const small_header = {
        position : "relative",
        top : "4vh",
        left : "43.75vw",
        color : "white",
    };

  return (
    <div style = {main_div}>
        <h1 style = {header}>Enhance AI</h1>
        <p style = {small_header}>Enhance images using AI</p>
